INSERT INTO `mantis_bug_text_table` VALUES (15,'linux firefoxâ€˜s direction,use flash to upload file,flash sent the file information to upload.php.In upload.php,it can\'t use hearder() to redirect. ','',''),(16,'It can complish load balancing when more people upload files,but can\'t complish load balancing when only one person upload more files.','',''),(17,'After installation, need to change the owner of \"/srv/www/htdocs/smarty/templates_c/\" and \"/data/\" to wwwrun.www; this should be done in configuration process after install on file server node. ','',''),(18,'files in different directories with same file name shoud be taken as different files other than as different versions of one same file','',''),(19,'the limit of the biggest file size of uploaded files should be configured by user other than fixed in code (currently 10M)','',''),(20,'files with Chinese name can not be display correctly ','',''),(21,'client should get full information (ip, location, etc) from manager server, and then ask file server to finish ingesting file. File server can finish all work depending on the information from client, and should not read information from local configuration file for each ingesting.\r\n','',''),(22,'CSC provides two replicas for each file. Client gets the information of replication server and location etc from manager server together with information of file server, and sends to file server. File server finish local ingest and remote replication, and then tell manager server to update database.\r\n\r\nDetails are needed for this issue.','',''),(23,'for some reason I still haven\'t found, my apache2::error_log file is being populated with: [error] Failed to change_hat to \'HANDLING_UNTRUSTED_INPUT\'\r\n\r\nBrowsing through the internet I found some posts from 20007 and 2006 pointing to AppArmor:\r\nhttp://forge.novell.com/pipermail/apparmor-general/2007-January/000228.html\r\nhttp://lists.suse.com/archive/suse-sles-e/2006-Jul/0175.html\r\n\r\nso I deactivated that (a2dismod apparmor) Apache2 module and now the error message is gone.\r\n\r\nFirst (obvious) questions:\r\n* is Apache2 now less secure?\r\n* is there any way to solve this issue?\r\n\r\nFor the sake of completion I have to say that I don\'t use AppArmor at all :-) --which causes some debate, too: AppArmor yes, AppArmor no? \r\n\r\n\r\n\r\n','','If you have a server, AA is a good thing to have. But it can also be a nuisance till adjusted. It ensures that if the daemon is compromised the attacker will not have access to files that were not allowed by design.\r\n\r\nIn this case of apache I don\'t know if the procedure is correct, but typically you fire the yast/apparmour/update profile wizard and do the proper adjustments,, ie, giving access to the files or directories that are needed.\r\n'),(33,'å¦‚æœæ‚¨æ”¶åˆ°é‚®ä»¶å¹¶èƒ½é“¾æ¥åˆ°è¿™é‡Œï¼Œåˆ™è¡¨æ˜å·¥ä½œæ­£å¸¸ã€‚','',''),(71,'ç«™ç‚¹ç¼–ç ã€çº¿è·¯ç¼–ç ã€ç­æ¬¡ç¼–ç éœ€è¦è‡ªåŠ¨ç”Ÿæˆï¼ˆçº¿è·¯è€ƒè™‘åŒçº¿è·¯çš„ä¸åŒæƒ…å†µï¼‰(æ§åˆ¶ä¸èƒ½é‡å¤æ·»åŠ è½¦ç‰Œå·)ã€‚åŒºåŸŸã€ç«™ç‚¹ã€çº¿è·¯ã€æœºæ„ã€è½¦è¾†ç®¡ç†ç­‰åŸºç¡€æ•°æ®éƒ½è¦å¢åŠ åºå·ï¼Œä¿®æ”¹æ•°æ®è¿”å›åèƒ½æ˜¾ç¤ºæ•°æ®ï¼Œå¹¶ä¸”èƒ½å¤Ÿå¯¼å‡ºæ•°æ®ã€‚\r\nçº¿è·¯èµ·ç‚¹ç»ˆç‚¹ç«™ä¸å…è®¸ä¿®æ”¹ï¼Œæäº¤æç¤ºä¸èƒ½ä¿®æ”¹è¯·ç¡®å®šã€‚\r\nåŒºåŸŸï¼Œç«™ç‚¹ï¼Œçº¿è·¯ï¼Œç­æ¬¡ç›¸å¯¹åº”çš„ç¼–ç å’Œåç§°åœ¨å®šä¹‰å¥½äº†ä¹‹åæ˜¯å¦éƒ½ä¸èƒ½è¢«ä¿®æ”¹å’Œåˆ é™¤ï¼Ÿå¦‚æœåˆ é™¤ä¼šä¸ä¼šæœ‰é”™ï¼Ÿç­æ¬¡å¯ä»¥åˆ ï¼›\r\nå½“å‰è½¦ç«™ç®¡ç†å‘˜åº”è¯¥åªèƒ½æ·»åŠ å‘è½¦ç«™ä¸ºè¯¥è½¦ç«™çš„æ‰€æœ‰çº¿è·¯å’Œç­æ¬¡ä¿¡æ¯ï¼Ÿåªæœ‰è¶…çº§ç®¡ç†å‘˜æœ‰æƒæ·»åŠ æ‰€æœ‰çš„','',''),(35,'æ‰€æœ‰çš„åˆ é™¤éƒ½æ˜¯â€œç¡®å®šåˆ é™¤è¯¥æ•°æ®ï¼Ÿâ€å¯ä»¥æ”¹ä¸ºâ€œç¡®å®šåˆ é™¤è¯¥åŒºåŸŸ/ç«™ç‚¹/ç­æ¬¡ç­‰â€ã€‚','',''),(36,'ç«™ç‚¹ç®¡ç†ï¼š\r\n    æŸ¥è¯¢ç•Œé¢ï¼šæŸ¥è¯¢æ¡ä»¶ï¼šâ€œæ‰€å±æœºæ„â€åº”è¯¥æ˜¯åŒ¹é…æœºæ„ç®¡ç†ä¸­çš„æ•°æ®çš„å¯é€‰ä¸‹æ‹‰æ¡†ã€‚','','logï¼š 885\r\nåœ¨svnä¸­æ›´æ–° \r\n'),(37,'ç«™ç‚¹ç®¡ç†ï¼š\r\n    æ·»åŠ ç•Œé¢ï¼šâ€œç«™ç‚¹ç±»å‹â€ä¸â€œæ˜¯å¦è½¦ç«™â€æœ‰çŸ›ç›¾ï¼šå¦‚æœé€‰äº†ç«™ç‚¹ç±»å‹ä¸ºè½¦ç«™ï¼Œä½†æ˜¯å»æ‰äº†â€œæ˜¯å¦è½¦ç«™çš„å‹¾â€ï¼Œæœªæç¤ºé”™è¯¯ï¼›åŒæ ·ï¼Œå¦‚æœç«™ç‚¹ç±»å