INSERT INTO `mantis_bugnote_text_table` VALUES (1,'1.show variables like \"%char%\"; to see whether related character set variables (character_set_client, character_set_connection, character_set_database, character_set_results, character_set_server)are the same values.\r\n2. To change the character_set_server value, add \"character-set-server = utf8\" in [mysqld] section of /etc/my.cnf, then restart server.\r\n3. To change character_set_client, character_set_connection and character_set_results, do as follows: add \"default-character-set=utf8\" in [client] section of /etc/my.cnf; add \"default-character-set=utf8\" in [mysqld] section of /etc/my.cnf; add \"init_connect=\'SET NAMES utf8\'\" in [mysqld] section of /etc/my.cnf; then restart server.\r\n4. To change character_set_database, use \"CREATE DATABASE manager character set utf8;\" in create.sql file.\r\n\r\nFinally, it should looks like this when execute \"show variables like\"%char%\";\".\r\n+--------------------------+----------------------------+\r\n| Variable_name            | Value                      |\r\n+--------------------------+----------------------------+\r\n| character_set_client     | utf8                       |\r\n| character_set_connection | utf8                       |\r\n| character_set_database   | utf8                       |\r\n| character_set_filesystem | binary                     |\r\n| character_set_results    | utf8                       |\r\n| character_set_server     | utf8                       |\r\n| character_set_system     | utf8                       |\r\n| character_sets_dir       | /usr/share/mysql/charsets/ |\r\n+--------------------------+----------------------------+\r\n5. Set related php scripts to use \"utf8\" encoding.\r\n\r\nWhat need to do: \r\n(1) modify my.cnf file during configuration process;\r\n(2) Modify create.sql following step 4;\r\n(3) For Chinese system, use \"gbk\" instead of \"utf8\", it will work well.\n\n'),(2,'If file server returns manager server after finishing remote replication, it may take more time to respond to user. An approach is to run a daemon on manager server which checks database periodically to find files having one replica, selects replicated server and instructs source file server to finish replication. After finishing complication, source file server will inform manager server to update database.'),(5,'For mantis to use Chinese, the above method works for new built tables. It is good idea to set well at the installation stage.'),(7,'ï¼ˆ1ï¼‰å·²ä¿®æ”¹ï¼Œå¹¶æ›´æ–°åˆ°svnä¸­\r\nï¼ˆ2ï¼‰æ›´æ–°åºå·ä¸º 887'),(8,'1ï¼šå·²ä¿®æ”¹ï¼Œå¹¶æäº¤åˆ°svnä¸Š\r\n2ï¼šç¼–å· 888'),(9,'æ€»æ•°ç»Ÿè®¡æœªæ”¹ï¼Œä»ä¸º0'),(10,'1ï¼šæäº¤åˆ°svnï¼Œåºå·ä¸º889'),(11,'1ï¼šsvn log889'),(12,'1:æ›´æ–°åˆ°svnï¼Œlog 889'),(13,'åªåŠ äº†*å·æ²¡åšJSæ§åˆ¶ï¼Œä¿®æ”¹æ²¡æ”¹'),(14,'svn log 892ï¼Œ893'),(15,'æ›´æ–°svn 889'),(16,'1ï¼šç­æ¬¡è¡¨å’Œç­æ¬¡åœé ç‚¹çš„è¡¨ä¸­æ£€ç¥¨å£å­—æ®µå‡ä¸ºintç±»å‹ï¼Œintç±»å‹é»˜è®¤å°†ç©ºå€¼å­˜ä¸º0\r\nè§£å†³æ–¹æ¡ˆ1ï¼š\r\nä¿®æ”¹æ•°æ®åº“å­—æ®µï¼š\r\nalter table tms_bd_NoRunsInfo modify nri_CheckTicketWindow varchar(11);\r\nalter table tms_bd_NoRunsDockSite modify nds_CheckTicketWindow varchar(11);\r\næ–¹æ¡ˆäºŒï¼š\r\nåœ¨ç¨‹åºä¸­æ·»åŠ åˆ¤æ–­ï¼Œä¸º0æ—¶ä½¿æ˜¾ç¤ºå­—æ®µä¸ºç©ºï¼›\r\n\r\nç”±äºç¨‹åºå¤šå¤„ä½¿ç”¨åˆ°æ£€ç¥¨å£ä¿¡æ¯ï¼Œå»ºè®®ä½¿ç”¨æ–¹æ¡ˆ1è§£å†³'),(17,'svn894ï¼šè°ƒä»·é¡µé¢ç­æ¬¡æ”¹ä¸ºä¸å¯ç¼–è¾‘çš„ï¼›æ¨¡ç³ŠæŸ¥è¯¢æ”¹ä¸ºå®Œå…¨åŒ¹é…'),(18,'svn894ï¼šsearåˆ°delè¿å¸¦ç­æ¬¡ç¼–å·æ—¶å°‘å†™äº†ä¸€ä¸ªç­‰å·'),(19,'svn 895'),(20,'  æå®šäº†'),(21,'ç‰ˆæœ¬902'),(23,'svnï¼š903ï¼Œtms_v1_basedata_modline.phpï¼Œå°±æ˜¯ä»æ•°æ®åº“é‡Œè¯»åäº†'),(24,'svnç‰ˆæœ¬904 '),(25,'svnç‰ˆæœ¬904'),(26,'svn 905 906 907'),(27,'æå®š  svn905 906 907'),(28,'    svn 905 906 907'),(29,' svn 905 906 907'),(30,'svn908ï¼šæ”¹æ­£ä¸‹é¢é—®é¢˜çš„åŒæ—¶å‘ç°è½¦è¾†ä¿¡æ¯ç¡®è®¤é‡Œè¿”å›çš„æ—¶å€™ä¹Ÿæ²¡æ‰¾ä¸åˆ°ï¼Œè¿˜æœ‰è½¦è¾†ä¿¡æ¯é‡Œçš„æ•°æ®åº”è¯¥ä¸ºreadonlyï¼Œä¸€èµ·åšäº†æ”¹æ­£ã€‚'),(31,'çº¿è·¯è°ƒä»·è·Ÿç«™åŠ¡è´¹æ²¡åŠ å³é”®'),(32,'ç¡®è®¤æ”¹é—®é¢˜å·²è§£å†³'),(33,'ç¡®è®¤å·²è§£å†³'),(34,'ç¡®è®¤å·²è